<dialog id="zoom"><canvas></canvas></dialog>
</body>

<script>
	var calibratorSize = {};
	var mapSize = {};
	var windowSize = 306;
	var windowLeft = 207;
	var windowTop = 406;
	var objCalibrator = document.getElementById('calibrator');
	var objMap = document.getElementById('map');
	var objModal = document.getElementById('zoom')
	var ctx = document.createElement("canvas").getContext("2d", {willReadFrequently: true});
	var ctxZoom = objModal.querySelector("canvas").getContext("2d");
	ctxZoom.canvas.width = windowSize;
	ctxZoom.canvas.height = windowSize;	
	init();
	
	function init() {
		var positionX = (document.body.offsetWidth - objCalibrator.offsetWidth) / 2;
		var positionY = (document.body.offsetHeight - objCalibrator.offsetHeight) / 2;
		setPos(positionX, positionY);
		calibratorSize = getActualSize(objCalibrator);
		mapSize = getActualSize(objMap);
	}
	
	function setPos(left, top) {
		objCalibrator.style.left = left + 'px';
		objCalibrator.style.top  = top + 'px';
	}
	
	function getActualSize(obj) {
		var response = {}
		
		var ar = obj.naturalWidth / obj.naturalHeight;
		
		if (obj.width / obj.height < ar) {
			response.width = obj.width;
			response.height = obj.width * (1 / ar);
		} else {
			response.height = obj.height;
			response.width = obj.height * ar;
		}
		response.offsetX = (obj.width - response.width) / 2;
		response.offsetY = (obj.height - response.height) / 2;
		response.scaleX = response.width / obj.naturalWidth;
		response.scaleY = response.height / obj.naturalHeight;
		response.paddedWidth = obj.width;
		response.paddedHeight = obj.height;
		
		return response;
	}
	
	function repositionDiv(position)  {
		var calOffset = objCalibrator.offsetWidth / 2;
		if (position.x < -calOffset) {
			position.x = -calOffset;
		} else if (position.x > document.body.offsetWidth - objCalibrator.offsetWidth + calOffset) {
			position.x = document.body.offsetWidth - objCalibrator.offsetWidth + calOffset;
		}
		var calOffset = objCalibrator.offsetHeight / 2;
		if (position.y < -calOffset) {
			position.y = -calOffset;
		} else if (position.y > document.body.offsetHeight - objCalibrator.offsetHeight + calOffset) {
			position.y = document.body.offsetHeight - objCalibrator.offsetHeight + calOffset;
		}
		setPos(position.x, position.y);
	}
	
	function isPixelTransparent(pageX, pageY) {
		var size = getActualSize(objCalibrator);
		
		ctx.canvas.width = size.width;
		ctx.canvas.height = size.height;
				
		ctx.drawImage(objCalibrator, 0, 0, ctx.canvas.width, ctx.canvas.height);
		var alpha = ctx.getImageData(pageX - objCalibrator.offsetLeft - size.offsetX, pageY - objCalibrator.offsetTop - size.offsetY, 1, 1).data[3];
		
		return (alpha == 0);
	}
	
	function handleMouseMove(e) {
		e.preventDefault();
		var mousePosition = {
			x: e.clientX += offset[0],
			y: e.clientY += offset[1]
		};
		repositionDiv(mousePosition);
	};
	function handleMouseUp() {
		document.removeEventListener('mousemove', handleMouseMove, true);
		document.removeEventListener('mouseup', handleMouseUp, true);
	}
	
	function handleTouchMove(e) {
		e.preventDefault();
		var mousePosition = {
			x: e.touches[0].clientX += offset[0],
			y: e.touches[0].clientY += offset[1]
		};
		repositionDiv(mousePosition);
	}
	
	function handleTouchEnd(e) {
		objCalibrator.removeEventListener('touchmove', handleTouchMove, true);
		objCalibrator.removeEventListener('touchend', handleTouchEnd, true);
	}
	
	objCalibrator.addEventListener('touchstart', function(e) {
		if (isPixelTransparent(e.touches[0].pageX, e.touches[0].pageY)) {
			return;
		}
		e.preventDefault();
		offset = [
			objCalibrator.offsetLeft - e.touches[0].clientX,
			objCalibrator.offsetTop - e.touches[0].clientY
		];
		objCalibrator.removeEventListener('touchmove', handleTouchMove, true);
		objCalibrator.removeEventListener('touchend', handleTouchEnd, true);
		objCalibrator.addEventListener('touchmove', handleTouchMove, true);
		objCalibrator.addEventListener('touchend', handleTouchEnd, true);
	}, true);
	
	objCalibrator.addEventListener('mousedown', function(e) {
		if (isPixelTransparent(e.pageX, e.pageY)) {
			return;
		}
		offset = [
			objCalibrator.offsetLeft - e.clientX,
			objCalibrator.offsetTop - e.clientY
		];
		document.removeEventListener('mouseup', handleMouseUp, true);
		document.removeEventListener('mousemove', handleMouseMove, true);
		document.addEventListener('mouseup', handleMouseUp, true);		
		document.addEventListener('mousemove', handleMouseMove, true);
	}, true);

	window.addEventListener("resize", function(e) {					
		var newMapSize = getActualSize(objMap);
		var newCalibratedSize = getActualSize(objCalibrator);
		
		var oldLeft = objCalibrator.offsetLeft - mapSize.offsetX + calibratorSize.offsetX;
		var oldTop = objCalibrator.offsetTop - mapSize.offsetY + calibratorSize.offsetY;
		
		var newLeft = newMapSize.width * oldLeft / mapSize.width + newMapSize.offsetX - newCalibratedSize.offsetX;
		var newTop = newMapSize.height * oldTop / mapSize.height + newMapSize.offsetY - newCalibratedSize.offsetY;
		
		setPos(newLeft, newTop);
	
		mapSize = newMapSize;
		calibratorSize = newCalibratedSize;
	}, true);
	
	objModal.addEventListener('click', function(e) {
		this.close();
	});
	
	objCalibrator.addEventListener('click', function(e) {
		var x = e.offsetX - calibratorSize.offsetX;
		var y = e.offsetY - calibratorSize.offsetY;
		var left = windowLeft * calibratorSize.scaleX;
		var right = (windowLeft + windowSize) * calibratorSize.scaleX;
		var top = windowTop * calibratorSize.scaleY;
		var bottom = (windowTop + windowSize) * calibratorSize.scaleY;
		
		if (x >= left && x <= right && y >=top && y <= bottom) {
			var mapLeft = (left - x + e.pageX - mapSize.offsetX) / mapSize.scaleX;
			var mapTop = (top - y + e.pageY - mapSize.offsetY) / mapSize.scaleY;
			ctxZoom.clearRect(0, 0, ctxZoom.canvas.width, ctxZoom.canvas.height);
			ctxZoom.drawImage(objMap, mapLeft, mapTop, ctxZoom.canvas.width, ctxZoom.canvas.height, 0, 0, ctxZoom.canvas.width, ctxZoom.canvas.height);
			objModal.showModal();
		}
	});
</script>
